package starpaterns2;

public class Pattern27 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		char n='E';
		for(char ch='A';ch<=n;ch++)
		{
			for(char c='A';c<=n;c++)
			{
				System.out.print(c+" ");
			}
			System.out.println();
		}

	}

}
